import React from "react";
import SearchBar from "./SearchBar";
import { NavLink } from "react-router-dom";


const Nav = ({ onSearch }) => {
    return (
      <nav>
        <SearchBar onSearch={onSearch} />
        <NavLink to='/About' activeClassName='active'>
          About
        </NavLink>
        <NavLink exact to='/' activeClassName='active'>
          Home
        </NavLink>
      </nav>
    );
  };

export default Nav;
